import styled from 'styled-components';

export const Navbar = styled.div`
  padding: 39px;
  a{
    text-align: left;
    font: normal normal medium 30px/38px;
    font-family: 'MADE TOMMY';
    letter-spacing: 0px;
    color: #071242;
    opacity: 1;
    & + a{
      margin-left: 33px;
    };
    border-bottom: none;
  }
`;

export const Sessions = styled.div`

`
